{
  "version": "0.2",
  "phases": {
    "install": {
      "commands": [
        "npm install -g aws-cdk",
        "npm install"
      ]
    },
    "build": {
      "commands": [
        "cdk deploy CdkMediapackageCloudfrontStack --context stackName=$STACK_NAME --require-approval never"
      ]
    }
  }
}
